import React from 'react'
import PurchaseTypesRow from './PurchaseTypesRow'

class PurchaseTypesList extends React.Component {

  render() {
      return (
          <tbody>
              {
                  this.props.listado.map((purchases) => {
                      return <PurchaseTypesRow key={ purchases.key }
                                           id={ purchases.key } 
                                           nombre={ purchases.nombre }
                                           precio={ purchases.precio }                                           
                                           funcionClick={this.props.funcionClick} />
                  })
              }
          </tbody>
      )
      
  }
}

export default PurchaseTypesList
